import React from 'react';

import Head from 'next/head';

function MyApp({ Component, pageProps }) {


  return (

    <>
      <Head>
        <title>Rick And Morty</title>
      </Head>
      <Document {...pageProps} />
    </>
  )
}


export default MyApp;
